import React from "react";
import Logo from "./img/Logo.png";
import AddIcon from "@material-ui/icons/Add";
const App = () => {
  return (
    <>
      <form>
        <input type="text" placeholder="Title" />
        <textarea cols="30" rows="10">
          Write a Note
        </textarea>
        <button>
          <AddIcon />
        </button>
      </form>
    </>
  );
};

export default App;
